// src/HorizontalCard.js

import React from "react";
import "./Paper.css"; // Make sure to create this CSS file for styling

const Paper = () => {
  return (
    <div className="paper">
      <span>Latest</span>
      <span>Rea</span>
      <div className="card-container">
        <div className="card-image">
          {/* Image goes here, you can use any placeholder image */}
          <img src="https://via.placeholder.com/150" alt="Placeholder" />
        </div>
        <div className="card-content">
          <h3>Card Title</h3>
          <p>
            This is the card content. It's a brief description or summary of
            what the card is about.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Paper;
